PyDoc_STRVAR(__pyx_doc_6gensim_6models_8word2vec_8Word2Vec___init__, "\n\n        Parameters\n        ----------\n        sentences : iterable of iterables, optional\n            The `sentences` iterable can be simply a list of lists of tokens, but for larger corpora,\n            consider an iterable that streams the sentences directly from disk/network.\n            See :class:`~gensim.models.word2vec.BrownCorpus`, :class:`~gensim.models.word2vec.Text8Corpus`\n            or :class:`~gensim.models.word2vec.LineSentence` in :mod:`~gensim.models.word2vec` module for such examples.\n            See also the `tutorial on data streaming in Python\n            <https://rare-technologies.com/data-streaming-in-python-generators-iterators-iterables/>`_.\n            If you don't supply `sentences`, the model is left uninitialized -- use if you plan to initialize it\n            in some other way.\n        corpus_file : str, optional\n            Path to a corpus file in :class:`~gensim.models.word2vec.LineSentence` format.\n            You may use this argument instead of `sentences` to get performance boost. Only one of `sentences` or\n            `corpus_file` arguments need to be passed (or none of them).\n        size : int, optional\n            Dimensionality of the word vectors.\n        window : int, optional\n            Maximum distance between the current and predicted word within a sentence.\n        min_count : int, optional\n            Ignores all words with total frequency lower than this.\n        workers : int, optional\n            Use these many worker threads to train the model (=faster training with multicore machines).\n        sg : {0, 1}, optional\n            Training algorithm: 1 for skip-gram; otherwise CBOW.\n        hs : {0, 1}, optional\n            If 1, hierarchical softmax will be used for model training.\n            If 0, and `negative` is non-zero, negative sampling will be used.\n        negative : int, optional\n            If > 0, negative sampling will be used, the int for negative specifies how many ""\"noise words\"\n            should be drawn (usually between 5-20).\n            If set to 0, no negative sampling is used.\n        ns_exponent : float, optional\n            The exponent used to shape the negative sampling distribution. A value of 1.0 samples exactly in proportion\n            to the frequencies, 0.0 samples all words equally, while a negative value samples low-frequency words more\n            than high-frequency words. The popular default value of 0.75 was chosen by the original Word2Vec paper.\n            More recently, in https://arxiv.org/abs/1804.04212, Caselles-Dupr\303\251, Lesaint, & Royo-Letelier suggest that\n            other values may perform better for recommendation applications.\n        cbow_mean : {0, 1}, optional\n            If 0, use the sum of the context word vectors. If 1, use the mean, only applies when cbow is used.\n        alpha : float, optional\n            The initial learning rate.\n        min_alpha : float, optional\n            Learning rate will linearly drop to `min_alpha` as training progresses.\n        seed : int, optional\n            Seed for the random number generator. Initial vectors for each word are seeded with a hash of\n            the concatenation of word + `str(seed)`. Note that for a fully deterministically-reproducible run,\n            you must also limit the model to a single worker thread (`workers=1`), to eliminate ordering jitter\n            from OS thread scheduling. (In Python 3, reproducibility between interpreter launches also requires\n            use of the `PYTHONHASHSEED` environment variable to control hash randomization).\n        max_vocab_size : int, optional\n            Limits the RAM during vocabulary building; if there are more unique\n            words than this, then prune the infrequent ones. Every 10 million word types need about 1GB of RAM.\n            Set to `None` for no limit.\n        max_final_vocab : int, optional\n            Limits the vocab to a target vo""cab size by automatically picking a matching min_count. If the specified\n            min_count is more than the calculated min_count, the specified min_count will be used.\n            Set to `None` if not required.\n        sample : float, optional\n            The threshold for configuring which higher-frequency words are randomly downsampled,\n            useful range is (0, 1e-5).\n        hashfxn : function, optional\n            Hash function to use to randomly initialize weights, for increased training reproducibility.\n        iter : int, optional\n            Number of iterations (epochs) over the corpus.\n        trim_rule : function, optional\n            Vocabulary trimming rule, specifies whether certain words should remain in the vocabulary,\n            be trimmed away, or handled using the default (discard if word count < min_count).\n            Can be None (min_count will be used, look to :func:`~gensim.utils.keep_vocab_item`),\n            or a callable that accepts parameters (word, count, min_count) and returns either\n            :attr:`gensim.utils.RULE_DISCARD`, :attr:`gensim.utils.RULE_KEEP` or :attr:`gensim.utils.RULE_DEFAULT`.\n            The rule, if given, is only used to prune vocabulary during build_vocab() and is not stored as part of the\n            model.\n\n            The input parameters are of the following types:\n                * `word` (str) - the word we are examining\n                * `count` (int) - the word's frequency count in the corpus\n                * `min_count` (int) - the minimum count threshold.\n        sorted_vocab : {0, 1}, optional\n            If 1, sort the vocabulary by descending frequency before assigning word indexes.\n            See :meth:`~gensim.models.word2vec.Word2VecVocab.sort_vocab()`.\n        batch_words : int, optional\n            Target size (in words) for batches of examples passed to worker threads (and\n            thus cython routines).(Larger batches will be passed if individual""\n            texts are longer than 10000 words, but the standard cython code truncates to that maximum.)\n        compute_loss: bool, optional\n            If True, computes and stores loss value which can be retrieved using\n            :meth:`~gensim.models.word2vec.Word2Vec.get_latest_training_loss`.\n        callbacks : iterable of :class:`~gensim.models.callbacks.CallbackAny2Vec`, optional\n            Sequence of callbacks to be executed at specific stages during training.\n\n        Examples\n        --------\n        Initialize and train a :class:`~gensim.models.word2vec.Word2Vec` model\n\n        .. sourcecode:: pycon\n\n            >>> from gensim.models import Word2Vec\n            >>> sentences = [[\"cat\", \"say\", \"meow\"], [\"dog\", \"say\", \"woof\"]]\n            >>> model = Word2Vec(sentences, min_count=1)\n\n        ");
