PyDoc_STRVAR(__pyx_doc_6gensim_6models_8word2vec_8Word2Vec_10train, "Update the model's neural weights from a sequence of sentences.\n\n        Notes\n        -----\n        To support linear learning-rate decay from (initial) `alpha` to `min_alpha`, and accurate\n        progress-percentage logging, either `total_examples` (count of sentences) or `total_words` (count of\n        raw words in sentences) **MUST** be provided. If `sentences` is the same corpus\n        that was provided to :meth:`~gensim.models.word2vec.Word2Vec.build_vocab` earlier,\n        you can simply use `total_examples=self.corpus_count`.\n\n        Warnings\n        --------\n        To avoid common mistakes around the model's ability to do multiple training passes itself, an\n        explicit `epochs` argument **MUST** be provided. In the common and recommended case\n        where :meth:`~gensim.models.word2vec.Word2Vec.train` is only called once, you can set `epochs=self.iter`.\n\n        Parameters\n        ----------\n        sentences : iterable of list of str\n            The `sentences` iterable can be simply a list of lists of tokens, but for larger corpora,\n            consider an iterable that streams the sentences directly from disk/network.\n            See :class:`~gensim.models.word2vec.BrownCorpus`, :class:`~gensim.models.word2vec.Text8Corpus`\n            or :class:`~gensim.models.word2vec.LineSentence` in :mod:`~gensim.models.word2vec` module for such examples.\n            See also the `tutorial on data streaming in Python\n            <https://rare-technologies.com/data-streaming-in-python-generators-iterators-iterables/>`_.\n        corpus_file : str, optional\n            Path to a corpus file in :class:`~gensim.models.word2vec.LineSentence` format.\n            You may use this argument instead of `sentences` to get performance boost. Only one of `sentences` or\n            `corpus_file` arguments need to be passed (not both of them).\n        total_examples : int\n            Count of sentences.\n        total_words : int\n            C""ount of raw words in sentences.\n        epochs : int\n            Number of iterations (epochs) over the corpus.\n        start_alpha : float, optional\n            Initial learning rate. If supplied, replaces the starting `alpha` from the constructor,\n            for this one call to`train()`.\n            Use only if making multiple calls to `train()`, when you want to manage the alpha learning-rate yourself\n            (not recommended).\n        end_alpha : float, optional\n            Final learning rate. Drops linearly from `start_alpha`.\n            If supplied, this replaces the final `min_alpha` from the constructor, for this one call to `train()`.\n            Use only if making multiple calls to `train()`, when you want to manage the alpha learning-rate yourself\n            (not recommended).\n        word_count : int, optional\n            Count of words already trained. Set this to 0 for the usual\n            case of training on all words in sentences.\n        queue_factor : int, optional\n            Multiplier for size of queue (number of workers * queue_factor).\n        report_delay : float, optional\n            Seconds to wait before reporting progress.\n        compute_loss: bool, optional\n            If True, computes and stores loss value which can be retrieved using\n            :meth:`~gensim.models.word2vec.Word2Vec.get_latest_training_loss`.\n        callbacks : iterable of :class:`~gensim.models.callbacks.CallbackAny2Vec`, optional\n            Sequence of callbacks to be executed at specific stages during training.\n\n        Examples\n        --------\n        .. sourcecode:: pycon\n\n            >>> from gensim.models import Word2Vec\n            >>> sentences = [[\"cat\", \"say\", \"meow\"], [\"dog\", \"say\", \"woof\"]]\n            >>>\n            >>> model = Word2Vec(min_count=1)\n            >>> model.build_vocab(sentences)  # prepare the model vocabulary\n            >>> model.train(sentences, total_examples=model.corpus_""count, epochs=model.iter)  # train word vectors\n            (1, 30)\n\n        ");
